values:
&nbsp;i can't wait until audio asylum on the 7th. i also can't wait till i gather up the homies and get my ass out on a dance floor. i&nbsp; need to organize something, and stop deleting club promoters off of my myspace. i miss partying 4 times a week with my brother.&nbsp;what happened to me? i used to have so much fun... now im like a little old lady with her cat and her cross stitching. it's REALLY lame!!!

so tell me, because i know you know, what is there to do on the 22nd and the 23rd? i can find a billion house/minimalist techno events but i need something more upbeat. anything goes except anything rap or pop music oriented. and no concerts.&nbsp;

im seriously sick of concerts.&nbsp;

so&nbsp;i need to do something those nights or i'm gonna implode on myself.

i just finished watching the third act of spike lee's "when the levees broke," the documentary about hurricane katrina&nbsp;and wow. god. it had me sobbing. my heart is breaking for all of these poor people...&nbsp; 

there is so much i could say about the bush administration, about the failure of our government and all that... but i think we've&nbsp;heard it all and i just suggest watching the documentary. 

but i do have to say... 

the bush family are satan's spawn, if satan were in fact to be real. the nerve of barbara fucking bush. that stupid fucking heartless bitch. to say that the people in the astrodome and superdome were better off than they were originally&nbsp;in their homes, with their families and loved ones... to try to act as though it's better for them to be sleeping on a fucking cot worrying about being robbed and raped in the night is sickening. has she no perspective, has she no ability to think about the trauma and nightmare these people have gone through? AUGH!&nbsp; 

this is a direct quote from barbara bush taken from video footage: 
&nbsp;"what im hearing which is sort of scary is they all wanna stay in texas. Everybody is so overwhelmed by the hospitality and so many of the people in the arenas here, you know, were underprivileged anyway. this is working very well for them." 

HELLO YOU FUCKING IDIOT. besides her fear ("which is sort of scary") that was probably fueled by racism and ignorance, she seems to lack any knowledge whatsoever on the conditions in new orleans. did she miss the memo or&nbsp;something?&nbsp;they want to stay in texas because there is NOTHING for them in new orleans. they have no houses, no schools, no hospitals, no stores, no work. im sure they all want to go back home but there is little they can do there without the resources and assistance they need to rebuild their lives and their communities.&nbsp;

let me just say also that i will give her a bit of a chance and hope that her fear of the people being in houston was out of concern for there not being enough resources to sustain the influx&nbsp;and not&nbsp;out of racism but i really truly doubt it. i have no faith in that family. 

people keep talking about how they wonder about the ethics of the clinton family because of bills infidelity and yet i don't hear anybody questioning the moral integrity of the bush family and their utter lack of compassion and concern for human lives!!! getting your dick sucked is not even in the same realm as the insensitive bullshit barbara bush comes spewing out with. she raised her children with those morals and that fucked up heart and look at the fucking president we have today. 

im sick.
